import { Link } from "react-router-dom";
import React, { useState, useEffect } from "react";



function NavTeacher() {
  const [teacher, setTeacher] = useState("1");

  useEffect(() => {
    fetch("/api/小提琴")
    .then((res) => res.json())
    .then((data) => setTeacher(data));
    console.log(teacher);
  }, []);


  return (
    <ul className="navTeacherUl">
      <li>
        <Link to="/Teacher" className="link navTeacher">小提琴1</Link>
      </li>
      <li>
        <Link to="/Teacher" className="link navTeacher">小提琴2</Link>
      </li>
      <li>
        <Link to="/Teacher" className="link navTeacher">小提琴3</Link>
      </li>
      <li>
        <Link to="/Teacher" className="link navTeacher">小提琴4</Link>
      </li>
      <li>
        <Link to="/Teacher" className="link navTeacher">小提琴5</Link>
      </li>
      <li>
        <Link to="/Teacher" className="link navTeacher">小提琴6</Link>
      </li>
    </ul>
  );
};

export default NavTeacher;
